// src/components/Dashboard.jsx
import React, { useEffect, useState } from 'react';

const Dashboard = () => {
  const [dashboardData, setDashboardData] = useState({
    totalSales: 150000,
    refundRate: 5,
    topSKUs: 50,
    topCreators: 30,
    campaignROI: 25,
    daily: 5000,
    weekly: 35000,
    monthly: 150000,
  });

  useEffect(() => {
    // Simulate fetching data
    const mockData = {
      totalSales: 150000,
      refundRate: 5,
      topSKUs: 50,
      topCreators: 30,
      campaignROI: 25,
      daily: 5000,
      weekly: 35000,
      monthly: 150000,
    };

    setTimeout(() => {
      setDashboardData(mockData); // Update state with the mock data
    }, 1000); // Simulate 1-second delay
  }, []);

  return (
    <div>
      <h2>Dashboard Overview</h2>

      {/* Displaying Cards for Daily, Weekly, and Monthly */}
      <div className="cards-container">
        <div className="card">
          <h3>Daily</h3>
          <p>Total Sales: ${dashboardData.daily}</p>
          <p>Refund Rate: {dashboardData.refundRate}%</p>
          <p>Top SKUs: {dashboardData.topSKUs}</p>
          <p>Top Creators: {dashboardData.topCreators}</p>
          <p>Campaign ROI: {dashboardData.campaignROI}%</p>
        </div>

        <div className="card">
          <h3>Weekly</h3>
          <p>Total Sales: ${dashboardData.weekly}</p>
          <p>Refund Rate: {dashboardData.refundRate}%</p>
          <p>Top SKUs: {dashboardData.topSKUs}</p>
          <p>Top Creators: {dashboardData.topCreators}</p>
          <p>Campaign ROI: {dashboardData.campaignROI}%</p>
        </div>

        <div className="card">
          <h3>Monthly</h3>
          <p>Total Sales: ${dashboardData.monthly}</p>
          <p>Refund Rate: {dashboardData.refundRate}%</p>
          <p>Top SKUs: {dashboardData.topSKUs}</p>
          <p>Top Creators: {dashboardData.topCreators}</p>
          <p>Campaign ROI: {dashboardData.campaignROI}%</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
